// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract MedicalRecords {
    struct Record {
        string ipfsHash;
        uint256 timestamp;
    }

    mapping(address => Record[]) private records;
    mapping(address => mapping(string => bool)) public approvedDocs;

    event RecordAdded(address indexed patient, string ipfsHash, uint256 timestamp);
    event DocumentApproved(address indexed patient, string ipfsHash, uint256 timestamp);

    function addRecord(address patient, string memory ipfsHash) public {
        records[patient].push(Record(ipfsHash, block.timestamp));
        emit RecordAdded(patient, ipfsHash, block.timestamp);
    }

    function getRecords(address patient) public view returns (Record[] memory) {
        return records[patient];
    }

    function approveDocument(string memory ipfsHash) public {
        approvedDocs[msg.sender][ipfsHash] = true;
        emit DocumentApproved(msg.sender, ipfsHash, block.timestamp);
    }

    function isDocumentApproved(address patient, string memory ipfsHash) public view returns (bool) {
        return approvedDocs[patient][ipfsHash];
    }

    function getApprovedDocuments(address patient) public view returns (string[] memory) {
        Record[] memory allRecords = records[patient];
        uint256 count = 0;
        for (uint256 i = 0; i < allRecords.length; i++) {
            if (approvedDocs[patient][allRecords[i].ipfsHash]) {
                count++;
            }
        }
        string[] memory approved = new string[](count);
        uint256 idx = 0;
        for (uint256 i = 0; i < allRecords.length; i++) {
            if (approvedDocs[patient][allRecords[i].ipfsHash]) {
                approved[idx] = allRecords[i].ipfsHash;
                idx++;
            }
        }
        return approved;
    }
}

